// src/components/Worker Dashboard/RewardsPage.js
import React from 'react';

const RewardsPage = () => {
  return (
    <div className="page-container">
      <h2>Rewards</h2>
      <p>Be compliant and receive rewards.</p>
    </div>
  );
};

export default RewardsPage;
